import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding: 4px 0;
  width: 200px;
  background-color: green;
`;

export const ArrowButton = styled.button`
  :first-of-type {
    padding-left: 20px;
  }

  :last-of-type {
    padding-right: 20px;
  }
`;
